import { useEffect, useState } from "react";
import axios from "axios";

export default function Tipos() {
  const [tipos, setTipos] = useState([]);
  const [form, setForm] = useState({ nombre: "" });
  const [editingId, setEditingId] = useState(null);

  useEffect(() => {
    fetchTipos();
  }, []);

  const fetchTipos = () => {
    axios.get("http://localhost:4000/api/tipos")
      .then(res => setTipos(res.data));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (editingId) {
      axios.put(`http://localhost:4000/api/tipos/${editingId}`, form)
        .then(() => { fetchTipos(); resetForm(); });
    } else {
      axios.post("http://localhost:4000/api/tipos", form)
        .then(() => { fetchTipos(); resetForm(); });
    }
  };

  const eliminar = (id) => {
    axios.delete(`http://localhost:4000/api/tipos/${id}`)
      .then(() => fetchTipos());
  };

  const editar = (t) => {
    setForm({ nombre: t.nombre });
    setEditingId(t.id);
  };

  const resetForm = () => {
    setForm({ nombre: "" });
    setEditingId(null);
  };

  return (
    <div style={{ background: "#f4f6f9", padding: "20px", borderRadius: "12px" }}>
      <h2 style={{ marginBottom: "20px" }}>üì¶ Administraci√≥n de Tipos</h2>

      {/* FORMULARIO */}
      <form onSubmit={handleSubmit} style={{
        display: "flex",
        gap: "10px",
        background: "white",
        padding: "20px",
        borderRadius: "12px",
        marginBottom: "20px"
      }}>
        <input
          placeholder="Nombre del tipo"
          value={form.nombre}
          onChange={(e) => setForm({ nombre: e.target.value })}
          required
          style={inputStyle}
        />

        <button type="submit" style={btnGuardarStyle}>
          {editingId ? "Actualizar" : "Crear"}
        </button>
      </form>

      {/* TABLA */}
      <table style={tableStyle}>
        <thead>
          <tr>
            <th style={thStyle}>Tipo</th>
            <th style={thStyle}>Acciones</th>
          </tr>
        </thead>

        <tbody>
          {tipos.map(t => (
            <tr key={t.id} style={trStyle}>
              <td style={tdStyle}>{t.nombre}</td>
              <td style={tdStyle}>
                <button onClick={() => editar(t)} style={btnEditarStyle}>‚úèÔ∏è Editar</button>
                <button onClick={() => eliminar(t.id)} style={btnEliminarStyle}>‚ùå Eliminar</button>
              </td>
            </tr>
          ))}
        </tbody>

      </table>
    </div>
  );
}

const inputStyle = {
  padding: "10px",
  borderRadius: "8px",
  border: "1px solid #ccc",
  fontSize: "15px",
  width: "100%"
};

const btnGuardarStyle = {
  background: "#4a90e2",
  color: "white",
  border: "none",
  padding: "10px 18px",
  borderRadius: "8px",
  cursor: "pointer",
  fontSize: "16px"
};

const tableStyle = {
  width: "100%",
  borderCollapse: "collapse",
  background: "white",
  borderRadius: "12px",
  overflow: "hidden"
};

const thStyle = {
  background: "#4a90e2",
  color: "white",
  padding: "12px"
};

const trStyle = {
  borderBottom: "1px solid #ddd"
};

const tdStyle = {
  padding: "12px",
  textAlign: "center"
};

const btnEditarStyle = {
  marginRight: "10px",
  padding: "6px 10px",
  background: "#f1c40f",
  color: "black",
  border: "none",
  borderRadius: "6px",
  cursor: "pointer"
};

const btnEliminarStyle = {
  padding: "6px 10px",
  background: "#e74c3c",
  color: "white",
  border: "none",
  borderRadius: "6px",
  cursor: "pointer"
};
